    // isOpen1 is false.
    // need to open now.
    setIsOpen1(true);
  }
}

Navigationclass = () => (
   <nav>
     <ul className={styles.NaviText}>
       <li><NavLink exact activeClassName="current" to='/'>Home</NavLink></li>
       <li><NavLink exact activeClassName="current" to='/about'>About</NavLink></li>
       <li><NavLink exact activeClassName="current" to='/contact'>Contact</NavLink></li>
     </ul>
   </nav>
 );

NavigationBarComp = () => {
// 1st element.
  const [isOpen1, setIsOpen1] = useState(false);
  const toggle1open = () => {
    console.log(isOpen1)
    if(isOpen1 == true)
    {
      // opened already, no need to open again.
      // to close, because it is already open.
      setIsOpen1(false);
    }
    else {
      // isOpen1 is false.
      // need to open now.
      setIsOpen1(true);
    }
  }
  const toggle1close = () => {
    if(isOpen1 == true)
    {
      // opened already, no need to open again.
      // need to close.
      setIsOpen1(false);
    }
    else { // isOpen1 is false.
      // closed already.
    }
  }
  const [collapse1, setCollapse1] = useState(false);

// 2nd element.
  const [isOpen2, setIsOpen2] = useState(false);
  const toggle2open = () => {
    if(isOpen2 == true)
    {
      // opened already, no need to open again.
      // to close, because it is already open.
      setIsOpen2(false);
    }
    else {
      // isOpen2 is false.
      // need to open now.
      setIsOpen2(true);
    }
  }
  const toggle2close = () => {
    if(isOpen2 == true)
    {
      // opened already, no need to open again.
      // need to close.
      setIsOpen2(false);
    }
    else { // isOpen2 is false.
      // closed already.
    }
  }
  const [collapse2, setCollapse2] = useState(false);

// 3rd element.
  const [isOpen3, setIsOpen3] = useState(false);
  const toggle3open = () => {
 if(isOpen3 == true)
   {
     // opened already, no need to open again.
     // to close, because it is already open.

     setIsOpen3(false);

   }
   else {
     // isOpen3 is false.
     // need to open now.
     setIsOpen3(true);
   }
 }
 const toggle3close = () => {
 if(isOpen3 == true)
 {
   // opened already, no need to open again.
   // need to close.
   setIsOpen3(false);
 }
 else { // isOpen3 is false.
   // closed already.
 }
}
  const [collapse3, setCollapse3] = useState(false);

// 4th element.
   const [isOpen4, setIsOpen4] = useState(false);
   const toggle4open = () => {
     if(isOpen4 == true)
     {
       // opened already, no need to open again.
       // to close, because it is already open.
       setIsOpen4(false);
     }
     else {
       // isOpen4 is false.
       // need to open now.
       setIsOpen4(true);
     }
   }
   const toggle4close = () => {
     if(isOpen4 == true)
     {
       // opened already, no need to open again.
       // need to close.
       setIsOpen4(false);
     }
     else { // isOpen4 is false.
       // closed already.
     }
   }
  const [collapse4, setCollapse4] = useState(false);

}
render(){
  return (
    <nav>
      <ul className={styles.NaviText}>
      <li className={styles.Navielements} onClick={this.toggle1open} onMouseLeave = {this.toggle1close}>
      <button id="btnFile" className={styles.btnclass}>FILE</button>
      <Collapse className={styles.collapse} isOpen={this.isOpen1}>
      <ul className={styles.DropdownNavi}>
        <li><NavLink exact activeClassName="current" to='/'>Home1</NavLink></li>
        <li><NavLink exact activeClassName="current" to='/about'>About1</NavLink></li>
        <li><NavLink exact activeClassName="current" to='/contact'>Contact1</NavLink></li>
     </ul>
      </Collapse>
      </li>

      <li className={styles.Navielements} onClick={this.toggle2open} onMouseLeave = {this.toggle2close}>
      <button className={styles.btnclass}>EDIT</button>
      <Collapse className={styles.collapse} isOpen={this.isOpen2}>
      <ul className={styles.DropdownNavi}>
        <li><NavLink exact activeClassName="current" to='/'>Home2</NavLink></li>
        <li><NavLink exact activeClassName="current" to='/about'>About2</NavLink></li>
        <li><NavLink exact activeClassName="current" to='/contact'>Contact2</NavLink></li>
     </ul>
      </Collapse>
      </li>

      <li className={styles.Navielements} onClick={this.toggle3open} onMouseLeave = {this.toggle3close}>
      <button className={styles.btnclass}>VIEW</button>
      <Collapse className={styles.collapse} isOpen={this.isOpen3}>
      <ul className={styles.DropdownNavi}>
        <li><NavLink exact activeClassName="current" to='/'>Home3</NavLink></li>
        <li><NavLink exact activeClassName="current" to='/about'>About3</NavLink></li>
        <li><NavLink exact activeClassName="current" to='/contact'>Contact3</NavLink></li>
     </ul>
      </Collapse>
      </li>

        <li className={styles.Navielements} onClick={this.toggle4open} onMouseLeave = {this.toggle4close}>
